import React, { useState, useEffect } from "react";
import axios from "axios";
function Form() {
	const [customers, setCustomers] = useState([]);
	useEffect(() => {
		axios("/api").then((res) => {
			setCustomers(res.data);
			console.log(customers);
		});
	}, []);

	return <div>{customers}</div>;
}

export default Form;
